const express = require("express");
const SignupBackend = express();
require("./db/conn");
const path = require("path");

const static_path = path.join(__dirname + "../src/hello");
SignupBackend.use(express.static(static_path));


SignupBackend.get("/src/hello", (req, res )=>{
    res.send("hello")
});

SignupBackend.listen(3001, () =>{
    console.log("Server is running at port number 3001")
});
